class Tester(UserStory):
    def __init__(self, description: str):
        super().__init__(description)

    def test_features_in_environments(self):
        logging.info("Testing features in environments")

def main():
    user_stories = [
        DataUser("Process deletions for 12-19-2017"),
        UI Designer("Redesign Resources page"),
        UI Designer("Report user testing results"),
        UI Designer("Move on to round 2 of DABS or FABS landing page edits"),
        UI Designer("Move on to round 2 of Homepage edits"),
        UI Designer("Move on to round 3 of Help page edits"),
        Developer("Log better"),
        Developer("Update FABS submission"),
        DevOpsEngineer("Provide New Relic data"),
        BrokerUser("Upload and validate error message"),
        WebsiteUser("Access published FABS files"),
        Owner("Reset environment"),
        AgencyUser("Include large number of flexfields"),
        AgencyUser("Deploy FABS to production"),
        Tester("Test features in environments")
    ]

    for user_story in user_stories:
        if isinstance(user_story, DataUser):
            user_story.process_deletions("12-19-2017")
        elif isinstance(user_story, UI Designer):
            if "Redesign Resources page" in user_story.description:
                user_story.redesign_resources_page()
            elif "Report user testing results" in user_story.description:
                user_story.report_user_testing()
            elif "Move on to round 2" in user_story.description:
                user_story.move_on_to_round2("DABS or FABS landing page")
            elif "Move on to round 3" in user_story.description:
                user_story.move_on_to_round3("Help page")
        elif isinstance(user_story, Developer):
            if "Log better" in user_story.description:
                user_story.log_better()
            elif "Update FABS submission" in user_story.description:
                user_story.update_fabs_submission()
            elif "Update Broker validation rule table" in user_story.description:
                user_story.update_broker_validation_rule_table()
            elif "Add GTAS window data" in user_story.description:
                user_story.add_gtas_window_data()
            elif "Manage D Files generation requests" in user_story.description:
                user_story.manage_d_files_generation_requests()
        elif isinstance(user_story, DevOpsEngineer):
            if "Provide New Relic data" in user_story.description:
                user_story.provide_new_relic_data()
        elif isinstance(user_story, BrokerUser):
            if "Upload and validate error message" in user_story.description:
                user_story.upload_and_validate_error_message()
            elif "Sync D1 file generation" in user_story.description:
                user_story.sync_d1_file_generation()
        elif isinstance(user_story, WebsiteUser):
            if "Access published FABS files" in user_story.description:
                user_story.access_published_fabs_files()
        elif isinstance(user_story, Owner):
            if "Reset environment" in user_story.description:
                user_story.reset_environment()
        elif isinstance(user_story, AgencyUser):
            if "Include large number of flexfields" in user_story.description:
                user_story.include_large_number_of_flexfields()
            elif "Deploy FABS to production" in user_story.description:
                user_story.deploy_fabs_to_production()
        elif isinstance(user_story, Tester):
            if "Test features in environments" in user_story.description:
                user_story.test_features_in_environments()

if __name__ == "__main__":
    main()
